import { createSlice } from '@reduxjs/toolkit';

const productSlice = createSlice({
  name: 'product',
  initialState: {
    image1: true,
    image2: false,
    image3: false,
    image4: false,
    image5: false,
  },
  reducers: {},
});

export const actionsProduct = productSlice.actions;
export default productSlice.reducer;
